  "autor": "Frank Sanchez",
  "imagen": "002.png",
  "contenido": "El día 9 de agosto de 2018 Urbanhub en alianza con Boosterwise y Sport World, tuvieron el honor de presentar una Master Class dedicada al tema de Ventas, impartida por el Director Comercial de Boosterwise México, Guillermo Estrada; quien es un joven proactivo con muchos años de experiencia en el área de ventas y mercadotecnia. \r\n\r\n\r\nEn esta Master Class de acceso exclusivo con un temario 80% practico se contó con la presencia de 51 personas; quienes tuvieron la oportunidad de vivir una gran experiencia que enriqueció su curriculum y además de obtener grandes beneficios como horas de consumo por parte de Urbanhub, Consultorías privadas con Boosterwise Y Membresías con Sports World. De igual manera se pudo disfrutar el delicioso café ofrecido por The Urban Corner.",
